        <style>
            body {

            }

                right: 0;
                width: 33%;
                height: 100%;
                margin: 0;

                background-color: rgba(34, 34, 34, 0.9);

                margin: 0;
                overflow-x: hidden;
            }

                white-space: nowrap;
            }

            li.nixy-title-level-2:before { content: '. . . . ';         color: rgb(100, 100, 100); }

                text-decoration: none;
            }

            .nixy-frame-list a:hover {

            }

            }

                position: absolute;
                top: 0;
                left: 1em;
                text-align: center;
                padding: 0.3em 0.6em;

                color: rgb(240, 255, 255);
                background-color: rgba(34, 34, 34, 0.9);

            .nixy-blank-screen {
                background: black;
                position: absolute;
                top: 0;
                left: 0;
                width: 100%;
                height: 100%;
                opacity: 100%;
                visibility: visible;
                z-index: 999;
                transition: opacity 0.5s, visibility 0.5s;
            }

            svg a {
                cursor: pointer;
            }

            @keyframes spinner {
                to { transform: rotate(360deg); }

                animation: spinner .8s linear infinite;
